        private void uxTotalPointsList_SelectedIndexChanged(object sender, EventArgs e) {
            if (uxTotalPointsList.SelectedItems.Count > 0) {
                try {
                    string[] playerName = uxTotalPointsList.SelectedItems[0].SubItems[1].ToString().Split('{', '}');
                    espnDictionary.TryGetValue(playerName[1], out double value);
                    string valueString = value.ToString();
                    WebRequest request = WebRequest.Create($"https://a.espncdn.com/combiner/i?img=/i/headshots/nfl/players/full/{valueString}.png&w=300&h=280");
                    using (var response = request.GetResponse()) {
                        using (var stream = response.GetResponseStream()) {
                            uxPictureBox.Image = Bitmap.FromStream(stream);
                        }
                    }
                } catch (Exception) {
                }
            }
        }

